class Solution(object):
    def minimumSeconds(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        def gcd(a, b):
            while b:
                a, b = b, a % b
            return a

        n = len(nums)
        if n == 1:
            return 0

        diff_set = set()
        for i in range(1, n):
            if nums[i] != nums[i-1]:
                diff_set.add((i-1, i))

        if nums[0] != nums[-1]:
            diff_set.add((n-1, 0))

        if not diff_set:
            return 0

        gcd_val = 0
        for x, y in diff_set:
            gcd_val = gcd(gcd_val, abs(x-y))

        if gcd_val <= 1:
            return 1

        for i in range(2, gcd_val+1):
            if gcd_val % i == 0:
                return i - 1

        return gcd_val - 1
